import React, { useState } from 'react';
import Home from './Home';
import Chat from './Chat';
import './style.css';

function App() {
  const [userData, setUserData] = useState(null); // nickname, gender, avatar

  return (
    <>
      {!userData ? (
        <Home onJoin={setUserData} />
      ) : (
        <Chat userData={userData} />
      )}
    </>
  );
}

export default App;
